  input: '"TEXT","SA11A1","","October 18, 2002 Mr. James Krebs Reports Analyst Report
    Division Federal Election Commission 999 E Street, NW Washington, DC  20463 Re:
    Kindred Healthcare, Inc. Political Action Committee I.D. No. C00 242271 Report
    for the month ending July 31, 2002 (filed August, 2002) Dear Mr. Krebs: I am writing
    in response to your letters dated October 2, 2002 concerning the report for the
    month July 31, 2002, filed in August, 2002, by Kindred Healthcare, Inc. PAC.  You
    ask in that letter that, among other things, the report be amended in the manner
    in which it reports contributions made by payroll deduction.  In particular, you
    ask that, for each contributor whose aggregate year-to-date contributions exceeded
    $200, the report indicate the aggregate amount of contributions made payroll deduction
    by such contributor during the reporting period, the amount contributed per pay
    period and the frequency of such contributions.  This would be in place of the
    manner in which the PAC reported such contributions, whereby it itemized each
    such contribution separately.  We respectfully decline to amend the report in
    this fashion because the manner in which such contributions were originally reported
    therein was correct and complied with the applicable regulations.  As you note
    in your letter, reporting such contributions is governed by Reg  104.8(b).  That
    provision generally requires that, starting when a contributor''s year-to-date
    aggregate contributions exceed $200, each contribution from that contributor be
    separately itemized.  As an exception to this rule, it provides -- but does not
    require -- that contributions made by payroll deduction may be reported as an
    aggregate total for the reporting period for each contributor, with an indication
    of the amount of such contribution per pay period and frequency thereof.  In our
    reports, we reported those contributions according to the general rule stated
    in the regulation -- i.e., separate itemization -- rather than according to the
    exception specially provided for payroll deductions whereby such contributions
    may (but are not required to) be reported in the aggregate.  In a conversation
    with our counsel on October 11, 2002, you agreed that contributions by payroll
    deduction may, as was done in our reports, be separately itemized and that our
    reports as originally filed are correct and do not need to be amended in this
    regard.  Very truly yours,  John Chadwick O''Bryan  Legislative Consultant"'
